import React, { useState, useEffect } from 'react';
import './App.css';
import BarraNav from './Componentes/BarraNav.jsx';
import Inicio from "./Pages/Inicio.jsx";
import SobreMi from "./Pages/SobreMi.jsx";
import Contacto from "./Pages/Contacto.jsx";

import ProyectosRND from './Pages/ProyectosRND.jsx';
import TarjetaRND from './Pages/TarjetaRND.jsx';
import PiedraPapelTijera from './Pages/PiedraPapelTijera.jsx';
import PiedraPapelTijeraConCSS from './Pages/PiedraPapelTijeraConCSS.jsx';

import logoBarra from './Img/gato-normal.jpg';


import { Routes, Route, Link } from 'react-router-dom';

function App() {


  const [windowSize, setWindowSize] = useState({
    width: window.innerWidth,
    height: window.innerHeight,
  });



  return (
    <div className="App">
      <div className='contenedor-cuerpo'>

        <div className='col-12 contBarraMovil'>
          <div className="col-ImgBarDesplegable col-1">
            <img
              className = 'imagenBarra'
              src = {logoBarra}
              alt = 'Logo barra nav' />
          </div>
          <div className='contBotonesDesplegables col-11'>
            <div class="dropdown">
              <button class="botonDrop btn-dark dropdown-toggle" type="button" data-bs-toggle="dropdown" aria-expanded="false">
                Menu
              </button>
              <ul className="contBotonesFix dropdown-menu padding0">
              <Link
                className='botonDesplegable margin0 text-center'
                to= "/portafolio-react">Inicio
              </Link>
              <Link
                className='botonDesplegable margin0'
                to="portafolio-react/Pages/SobreMi">Sobre Mi
              </Link>
              <Link
                className='botonDesplegable margin0'
                to="portafolio-react/Pages/Contacto">Contacto
              </Link>
              </ul>
            </div>
          </div>
        </div>


        <div className=''>
          <Routes>
            <Route path ="/portafolio-react" element = {<BarraNav />} >
              <Route path="/portafolio-react" element={<Inicio />} />
              <Route path="Pages/SobreMi" element={<SobreMi />} />
              <Route path="Pages/Contacto" element={<Contacto/>} />
              <Route path="Pages/ProyectosRND" element={<ProyectosRND/>} />
              <Route path="Pages/TarjetaRND" element={<TarjetaRND/>} />
              <Route path="Pages/PiedraPapelTijera" element={<PiedraPapelTijera/>} />
              <Route path="Pages/PiedraPapelTijeraConCSS" element={<PiedraPapelTijeraConCSS/>} />
            </Route>
          </Routes>
        </div>
      </div>
      <footer className='footer-app'>
        <label>paralelo-footer</label>
      </footer>
    </div>
  );
}

export default App;
